import React from 'react';
import styled from 'styled-components';


const EstiloButton = styled.div`
display: flex;
align-items: center;
border: 1px solid black;
border-radius: 50px;
width: 200px;
padding: 15px 30px;
margin: 10px auto;`


function ImagemButton(props) {
    return (
        <EstiloButton>
        <img src={ props.imagem }/>
        <p>{ props.texto }</p>
        </EstiloButton>



    )
}

export default ImagemButton;
